    def __init__(self, name=None, **kwargs):
        super().__init__(name, kwargs)

    def parse(self, response):

        global data_bem_estado_id, data_bem_cidade_id, data_bem_categoria_id

        if self.city in self.states_id:
            data_bem_estado_id = self.states_id[self.city]
            data_bem_cidade_id = '0'
        else:
            for state_id, state_cities in self.states_city_for_each_state.items():
                for city, city_id in state_cities.items():
                    if city == self.city:
                        data_bem_estado_id = state_id
                        data_bem_cidade_id = city_id

        if data_bem_estado_id is None and data_bem_cidade_id is None:
            return

        if self.category in [GTEnum.RESIDENTIAL, GTEnum.ALL]:
            data_bem_categoria_id = "218"
        elif self.category == GTEnum.RURAL:
            data_bem_categoria_id = "222"
        elif self.category == GTEnum.COMMERCIAL:
            data_bem_categoria_id = '256'

        data = {
            'data[Bem][estado_id]': data_bem_estado_id,
            'data[Bem][cidade_id]': data_bem_cidade_id,
            'data[Bem][categoria_id][]': data_bem_categoria_id,
        }

        url = 'https://www.amleiloeiro.com.br/externo/bens/pesquisaAvancada'

        yield FormRequest(url=url, formdata=data, callback=self.parse_response)

    def parse_response(self, response):
        item = AuctionsItem()
        divs = response.xpath('//div[@class="c-lote"]').extract()
        for div in divs:
            item['site'] = 'AM Leiloeiro'

            item['price'] = self.parser.get_single_value_from_string(raw_string=div, xpath='//big/text()')

            url = 'https://www.amleiloeiro.com.br' + self.parser.get_single_value_from_string(raw_string=div,
                                                                                              xpath='//div[@class="c-lote-descricao"]//a/@href')

            item['url'] = url

            yield response.follow(url=url, callback=self.parse_description, cb_kwargs=item)

    def parse_description(self, response, **kwargs):
        item = kwargs

        item['description'] = response.xpath('//p[@class="mb-3"]/text()').get()

        yield item
